jobs_results.description:
Contexte :
Dans le cadre d’un renfort, nous recherchons un Développeur Java VueJs (H/F) ;

Projet :
Votre intervenez sur un projet à forte valeur ajoutée dans le secteur de l’Assurance ;

La prestation se déroule dans le cadre de la création d’une équipe Digital pour prendre en charge l’analyse fonctionnelle et la réalisation des US du backlog et de la gestion courante.

Poste et missions :

Développer en Java/Spring ;
Développer les User Story du Front Office dans le respect des normes ;
Réalisation des tests unitaires et méthodologie TDD ;
Réalisation des interfaces si nécessaire ;
Mise à jour de la documentation technique ;
Participation aux cérémonies Agiles ;

Environnement Technique :
- Java 8 ;
- Spring / SpringBoot ;
- VueJs
- Angular 8+ ;
- Jenkins ;
- Docker ;
- Git & Gitlab
- Sonar
- Openshift ;
